import { Grid, TextField, InputAdornment, IconButton, Chip, Card, CardContent, Typography } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import BarChartIcon from '@mui/icons-material/BarChart';
import EventSeatIcon from '@mui/icons-material/EventSeat';
import TheatersIcon from '@mui/icons-material/Theaters';

const AdminDashboard = () => {
  return (
    <div style={{ padding: '24px' }}>
      {/* Search Bar (Search Result 1,3) */}
      <TextField
        fullWidth
        placeholder="Search movies, events, cinemas..."
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <SearchIcon />
            </InputAdornment>
          ),
        }}
        sx={{ mb: 4 }}
      />

      {/* Filter Chips (Search Result 3) */}
      <div style={{ marginBottom: '24px' }}>
        <Chip label="Movies" variant="outlined" sx={{ mr: 1 }} />
        <Chip label="Events" variant="outlined" sx={{ mr: 1 }} />
        <Chip label="Theaters" variant="outlined" />
      </div>

      {/* Key Metrics (Search Result 3,4) */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <MetricCard 
            title="Total Bookings"
            value="2,456"
            icon={<EventSeatIcon fontSize="large" />}
            progress={75}
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <MetricCard
            title="Active Shows"
            value="148"
            icon={<TheatersIcon fontSize="large" />}
            trend="+12%"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <MetricCard
            title="Total Revenue"
            value="$45,230"
            icon={<BarChartIcon fontSize="large" />}
            currency
          />
        </Grid>
      </Grid>

      {/* Main Content (Search Result 3,5) */}
      <Grid container spacing={3}>
        {/* Booking Management */}
        <Grid item xs={12} md={8}>
          <Card elevation={3}>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Recent Bookings
              </Typography>
              <div style={{ height: 400 }}>
                {/* DataGrid would go here */}
                <div style={{ 
                  display: 'flex', 
                  alignItems: 'center', 
                  justifyContent: 'center', 
                  height: '100%',
                  color: '#666'
                }}>
                  Booking management table
                </div>
              </div>
            </CardContent>
          </Card>
        </Grid>

        {/* Popular Movies */}
        <Grid item xs={12} md={4}>
          <Card elevation={3}>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Top Movies This Week
              </Typography>
              {/* Movie list would go here */}
              <div style={{ color: '#666' }}>
                <div>1. The Marvels (₹12.4M)</div>
                <div>2. Salaar (₹9.8M)</div>
                <div>3. Animal (₹7.2M)</div>
              </div>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
};

// Reusable Metric Card Component
const MetricCard = ({ title, value, icon, progress, trend }) => (
  <Card elevation={3}>
    <CardContent>
      <div style={{ display: 'flex', alignItems: 'center', gap: '16px' }}>
        <div style={{ color: '#1976d2' }}>{icon}</div>
        <div>
          <Typography variant="h5">{value}</Typography>
          <Typography variant="subtitle2" color="textSecondary">
            {title}
          </Typography>
          {progress && (
            <div style={{ marginTop: '8px', width: '100%', height: '8px', backgroundColor: '#eee', borderRadius: '4px' }}>
              <div style={{ 
                width: `${progress}%`, 
                height: '100%', 
                backgroundColor: '#4caf50',
                borderRadius: '4px'
              }} />
            </div>
          )}
          {trend && <span style={{ color: trend.startsWith('+') ? '#4caf50' : '#f44336' }}>{trend}</span>}
        </div>
      </div>
    </CardContent>
  </Card>
);

export default AdminDashboard;
